$(document).ready(function(){$("nav ul li a").on("click",function(){var link=$(this);var nav=link.closest("nav");var target=link.attr("href");var sections=nav.attr("data-sections");if(target.charAt(0)!=="#"&&!link.is(".nav-link")){return}$("li.selected",nav).removeClass("selected");link.closest("li").addClass("selected");if(!sections){return}$(sections).hide();$(target).show();var columnChart=$(".column-chart:visible");if(columnChart.length>0){HighTables.renderChart(columnChart[0])}return false});$(".underscore-version").text(_.VERSION);$(".lodash-version").text(lodash.VERSION)});